import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Car} from './painting-extra-details/painting-extra-details'

class App extends React.Component{
	state = {
		paintings:null
	};
	ReadDataFromDB() {

	}
}

function Appp() {
	return (
		<div className="App">
			<Header />
			<Cars />
			<Footer />
		</div>
	);
}

function Header() {
	return (
		<header><h2>Header</h2></header>
	);
}

function Footer() {
	return (
		<footer>Footer</footer>
		);
}

function Cars() {
	return Car();
}

export default App;
